import React from 'react'
import { CgProfile } from "react-icons/cg";

const Home = () => {
  return (
    <div className='w-[95%] h-[95%] bg-[#fff5f5] opacity-30 flex flex-row  '>
        <div className='bg-blue-500 w-[40%] h-full'>
            <nav className='bg-pink-500 h-[]'>
                <CgProfile className='text-[50px] text-yellow-200'></CgProfile>
            </nav>
            
        </div>
        <div className='bg-yellow-200'></div>
    </div>
  )
}

export default Home
